import React from "react";
import { Col, Row } from "react-bootstrap";
import { CgCPlusPlus, CgTrello } from "react-icons/cg";
import {
  DiJavascript1,
  DiReact,
  DiNodejs,
  DiMongodb,
  DiPython,
  DiGit,
  DiJava,
  DiGithub,
} from "react-icons/di";
import {
  SiRedis,
  SiFirebase,
  SiNextdotjs,
  SiSolidity,
  SiPostgresql,
  SiCsharp,
  SiJirasoftware,
} from "react-icons/si";
import { TbBrandGolang } from "react-icons/tb";

function CollaborationStack() {
  return (
    <Row style={{ justifyContent: "center", paddingBottom: "50px" }}>
      <Col xs={4} md={2} className="tech-icons">
        <CgTrello />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiJirasoftware />
      </Col>      
      <Col xs={4} md={2} className="tech-icons">
        <DiGithub />
      </Col>                              
    </Row>
  );
}

export default CollaborationStack;
